						["custom"] = "function()    \n    \n    local charges = select(1, GetSpellCharges(\"Wildfire Bomb\"))\n    local power = UnitPower(\"player\")\n    \n    --\"Shrapnel Bomb\"\n    do\n        local bomb_usable = WeakAuras.GetTriggerStateForTrigger(\"Wildfire Infusion\", 6)[\"\"]        \n        local debuff = select(1, AuraUtil.FindAuraByName(\"Shrapnel Bomb\", \"target\", \"HARMFUL|PLAYER\"))\n        if bomb_usable ~= nil and bomb_usable.show ~= nil and debuff == nil and (power >= 60 or (charges ~= nil and charges ==2))        \n        then        \n            aura_env.icon = 2065637\n            WeakAuras.Shrapnel_Attack = false\n            return true \n        elseif debuff ~= nil\n        then\n            local stacks = select(3, AuraUtil.FindAuraByName(\"Internal Bleeding\", \"target\", \"HARMFUL|PLAYER\"))\n            if stacks == nil or stacks < 3\n            then\n                WeakAuras.Shrapnel_Attack = true\n                return false\n            end                        \n        end\n        WeakAuras.Shrapnel_Attack = false\n    end\n    \n    --\"Pheromone Bomb\"\n    do\n        local bomb_usable = WeakAuras.GetTriggerStateForTrigger(\"Wildfire Infusion\", 7)[\"\"]\n        local debuff = select(1, AuraUtil.FindAuraByName(\"Pheromone Bomb\", \"target\", \"HARMFUL|PLAYER\"))\n        if bomb_usable ~= nil and bomb_usable.show ~= nil and debuff == nil and (power < 30 or (charges ~= nil and charges ==2))\n        then        \n            aura_env.icon = 2065635\n            WeakAuras.Pheromone_Attack = false\n            return true \n        elseif debuff ~= nil\n        --Prioritizing SerpentSting Over Focus Regain\n        --and (WeakAuras.SerpentSting_Missing_Target ~= nil and WeakAuras.SerpentSting_Missing_Target == 0)\n        --and (WeakAuras.SerpentSting_Expiring_Target ~= nil and WeakAuras.SerpentSting_Expiring_Target ==0)\n        then\n            WeakAuras.Pheromone_Attack = true       \n            return false       \n        end\n        WeakAuras.Pheromone_Attack = false\n    end\n    \n    \n    --\"Volatile Bomb\"\n    do        \n        local bomb_usable = WeakAuras.GetTriggerStateForTrigger(\"Wildfire Infusion\", 8)[\"\"]\n        if bomb_usable ~= nil and bomb_usable.show ~= nil\n        and (\n            (WeakAuras.SerpentSting_Missing_Target ~= nil and WeakAuras.SerpentSting_Missing_Target == 0)\n            or\n            (WeakAuras.SerpentSting_Expiring_Target ~= nil and WeakAuras.SerpentSting_Expiring_Target == 1)\n        )\n        then\n            aura_env.icon = 2065636        \n            return true  \n        end               \n    end\n    \n    return false\nend",
