			["customText"] = "function()       \n    if enhancementData ~= nil\n    then        \n        return      \n        \"---Flame Shock---\"   \n        .. \"\\nMissing: \" .. enhancementData.flameShock.missing        \n        .. \"\\nExpiring: \" .. enhancementData.flameShock.expiring        \n        .. \"\\nTaret Missing: \" .. enhancementData.flameShock.target.missing\n        .. \"\\nTarget Expiring: \" .. enhancementData.flameShock.target.expiring\n        ..\n        \"\\n---Lashing Flames---\"   \n        .. \"\\nMissing: \" .. enhancementData.lashingFlames.missing        \n        .. \"\\nExpiring: \" .. enhancementData.lashingFlames.expiring        \n        .. \"\\nTaret Missing: \" .. enhancementData.lashingFlames.target.missing\n        .. \"\\nTarget Expiring: \" .. enhancementData.lashingFlames.target.expiring\n        \n    end     \nend\n\n\n\n\n\n",
