					["custom"] = "survivalData = {   \n    [\"execute\"] = {\n        [\"count\"] = 0,\n        [\"target\"] = 0\n    },    \n    [\"serpentSting\"] = {\n        [\"missing\"] = 0,\n        [\"expiring\"] = 0,\n        [\"target\"] = {\n            [\"missing\"] = 0,\n            [\"expiring\"] = 0\n        }\n    },    \n    [\"killCommand\"] = {\n        [\"missing\"] = 0,\n        [\"expiring\"] = 0,\n        [\"target\"] = {\n            [\"missing\"] = 0,\n            [\"expiring\"] = 0\n        }\n    }    \n}",
