					["custom"] = "function()\n    local count = 0\n    for i = 1, 15 do\n        local unit = \"nameplate\"..i\n        if UnitCanAttack(\"player\", unit) and UnitThreatSituation(\"player\", unit) and WeakAuras.CheckRange(unit, 40, \"<=\")  \n        then\n            count = count + 1\n        end\n    end \n    WeakAuras.unitsInRange = count \nend",
