				["init"] = {
					["do_custom"] = true,
					["custom"] = "unitsInRange = {\n    [\"units\"] = {},    \n    [\"count\"] = 0,    \n    [\"healthy\"] = 0,\n    [\"bosses\"] = 0,\n    [\"weak\"] = 0    \n}\n\n\n\n",
