						["custom"] = "function()        \n    \n    unitsInRange.units = {}\n    \n    local myMaxHealth = UnitHealthMax(\"player\")\n    if GetNumSubgroupMembers() > 0\n    then\n        myMaxHealth = myMaxHealth * 4\n    end\n    \n    local count = 0\n    local countHealthy = 0\n    local countBoss = 0    \n    local countWeak = 0\n    local range = 40\n    \n    for i = 1, 40 do        \n        \n        local unit = \"nameplate\"..i\n        \n        if WeakAuras.CheckRange(unit, range, \"<=\")  \n        and (\n            (UnitCanAttack(\"player\", unit) and not UnitIsDead(unit)\n                and (\n                    select(4,UnitDetailedThreatSituation(\"player\", unit)) ~= nil \n                    or (UnitExists(\"target\") and UnitGUID(\"target\") == UnitGUID(unit))\n                )\n                and not string.match(select(1,string.lower(UnitName(unit)), \"totem\"))\n            )                    \n            or (aura_env.config[\"always_targets_enabled\"]\n                and string.match(select(1,strtrim(string.lower(UnitName(unit))), strtrim(string.lower(aura_env.config[\"always_targets\"])))) ~= nil)\n        )  \n        then                         \n            count = count + 1\n            local unitTable = {\n                [\"Healthy\"] = false,\n                [\"Tough\"] = false,\n                [\"Weak\"] = false\n            }\n            local classification = cFunction_UnitStrength(unit)\n            \n            if UnitHealth(\"unit\")  > myMaxHealth / 3\n            then\n                countHealthy = countHealthy + 1\n                unitTable.Healthy = true\n            end\n            if classification == \"Tough\"\n            then \n                countBoss = countBoss + 1\n                unitTable.Tough = true\n            end\n            if classification == \"Weak\"\n            then\n                coungWeak = countWeak + 1\n                unitTable.Weak = true\n            end\n            \n            unitsInRange.units[unit] = unitTable\n        end\n    end \n    \n    unitsInRange.count = count \n    unitsInRange.healthy = countHealthy\n    unitsInRange.bosses = countBoss\n    unitsInMelee.weak = countWeak\n    \n    return true\nend\n\n\n\n\n\n\n",
