			["customText"] = "function()    \n    if shadowData ~= nil\n    then\n        \n        return\n        \"---Devouring Plaque---\" \n        .. \"\\nSkip: \" .. shadowData.devouringPlague.skip\n        .. \"\\nTarget: \" .. shadowData.devouringPlague.target\n        ..\n        \"\\n---Shadow Word Death---\"   \n        .. \"\\nCount: \" .. shadowData.shadowWordDeath.count\n        .. \"\\nTarget: \" .. shadowData.shadowWordDeath.target\n        ..        \n        \"\\n---Shadow Word Pain---\"   \n        .. \"\\nMissing: \" .. shadowData.shadowWordPain.missing        \n        .. \"\\nExpiring: \" .. shadowData.shadowWordPain.expiring        \n        .. \"\\nTaret Missing: \" .. shadowData.shadowWordPain.target.missing\n        .. \"\\nTarget Expiring: \" .. shadowData.shadowWordPain.target.expiring\n        ..\n        \"\\n---Vampiric Touch---\"               \n        .. \"\\nMissing: \" .. shadowData.vampiricTouch.missing        \n        .. \"\\nExpiring: \" .. shadowData.vampiricTouch.expiring        \n        .. \"\\nTaret Missing: \" .. shadowData.vampiricTouch.target.missing\n        .. \"\\nTarget Expiring: \" .. shadowData.vampiricTouch.target.expiring \n    end    \nend",
