				["init"] = {
					["do_custom"] = true,
					["custom"] = "shadowData = {\n    [\"devouringPlague\"] = {    \n        [\"skip\"] = 0,\n        [\"target\"] = 0\n    },\n    [\"shadowWordDeath\"] = {\n        [\"count\"] = 0,\n        [\"target\"] = 0\n    },    \n    [\"shadowWordPain\"] = {\n        [\"missing\"] = 0,\n        [\"expiring\"] = 0,\n        [\"target\"] = {\n            [\"missing\"] = 0,\n            [\"expiring\"] = 0\n        }\n    },\n    [\"vampiricTouch\"] = {        \n        [\"missing\"] = 0,\n        [\"expiring\"] = 0,\n        [\"target\"] = {\n            [\"missing\"] = 0,\n            [\"expiring\"] = 0\n        }\n    }    \n}\n\nif not unitsInRange then\n    unitsInRange = {\n        [\"units\"] = {},\n        [\"count\"] = 0,    \n        [\"healthy\"] = 0,\n        [\"bosses\"] = 0,\n        [\"weak\"] = 0    \n    }\nend",
