nd not Berserk\n    and GetShapeshiftForm() == 2\n    then    \n        if unitsInMelee.count >= 5\n        then\n            feralActions[\"Brutal Slash\"].priority = 10                                              \n        else\n            feralActions[\"Brutal Slash\"].priority = 13\n        end \n    else\n        feralActions[\"Brutal Slash\"].priority = nil\n    end     \n    \n    return isAuraHighestPriority(\"Brutal Slash\", feralActions)\n    \nend\n\n\n\n\n\n",
