						["custom"] = "function()\n    \n    --Fireball\n    local countFireball = 0\n    local countFireball_Skip = 0    \n    local targetFireball = 0\n    \n    --Scorch\n    local countScorch = 0\n    local countScorch_Skip = 0    \n    local targetScorch = 0\n    \n    \n    local checkTarget = function(unit)\n        local target = false\n        if UnitExists(\"target\") and UnitGUID(\"target\") == UnitGUID(unit)\n        then\n            target = true\n        end                \n        local health = UnitHealth(unit)\n        local max_health = UnitHealthMax(unit)\n        local strength = cFunction_UnitStrength(unit)\n        \n        --Fireball\n        if cFunction_HasTalent(\"firestarter\")\n        then            \n            if health > max_health * .9 \n            --and strength ~= \"Weak\"\n            then\n                countFireball = countFireball + 1\n                if target then targetFireball = 1 end\n            else\n                countFireball_Skip = countFireball_Skip + 1                \n            end\n        end          \n        \n        --Scorch--\n        if cFunction_HasTalent(\"Searing Touch\")\n        then            \n            if health < max_health * .3 \n            --and strength ~= \"Weak\"\n            then\n                countScorch = countScorch + 1\n                if target then targetScorch = 1 end\n            else\n                countScorch_Skip = countScorch_Skip + 1                \n            end\n        end                \n    end   \n    \n    --Always check target and then scan for others\n    if UnitExists(\"target\") and UnitCanAttack(\"player\", \"target\") and not UnitIsDead(\"target\")     \n    --and select(4,UnitDetailedThreatSituation(\"player\", \"target\")) ~= nil    \n    then\n        checkTarget(\"target\")\n    end\n    \n    --Use Targets identified in unitsInMelee aura instead of repeating code here\n    for unit,_ in pairs(unitsInRange.units) do\n        if UnitGUID(\"target\") ~= UnitGUID(unit)\n        then            \n            checkTarget(unit)\n        end\n    end\n    \n    --legacy will remove\n    --for i = 1, 40 do\n    --    local unit = \"nameplate\"..i            \n    --    if WeakAuras.CheckRange(unit, range, \"<=\")\n    --    and UnitCanAttack(\"player\", unit) and not UnitIsDead(unit)\n    --    and (select(4,UnitDetailedThreatSituation(\"player\", unit)) ~= nil and (UnitGUID(\"target\") ~= UnitGUID(unit)))\n    --    and not string.match(select(1,UnitName(unit), \"Totem\")) and not string.match(select(1,UnitName(unit), \"totem\"))        \n    --    then\n    --        checkTarget(unit)\n    --    end                \n    --end \n    \n    --Fireball\n    fireData.fireBall.count = countFireball\n    fireData.fireBall.skip = countFireball_Skip\n    fireData.fireBall.target = targetFireball\n    \n    --Scorch\n    fireData.scorch.count = countScorch\n    fireData.scorch.skip = countScorch_Skip\n    fireData.scorch.target = targetScorch   \n    \n    return true\n    \nend\n\n\n\n",
