						["custom"] = "function()\n    \n    --Casting\n    if coolDown.cast.name ~= nil and coolDown.cast.name == \"Vampiric Touch\"\n    then\n        shadowActions[\"Vampiric Touch\"].casting.active = true\n        shadowActions[\"Vampiric Touch\"].casting.expirationTime = coolDown.cast.expirationTime        \n    else\n        shadowActions[\"Vampiric Touch\"].casting.active = false\n        shadowActions[\"Vampiric Touch\"].casting.expirationTime = nil\n    end \n    \n    --Priority\n    shadowActions[\"Vampiric Touch\"].priority = nil    \n    local voidForm = select(1,AuraUtil.FindAuraByName(\"Voidform\", \"player\", \"HELPFUL|PLAYER\"))\n    \n    if voidForm ~= nil and unitsInRange.count >= 6 and attackMode ~= \"Focus\"\n    then        \n        -- No spreading dots if void form and more than 5 targets        \n        shadowActions[\"Vampiric Touch\"].priority = nil\n    elseif unitsInRange.count >=3 and shadowActions[\"Shadow Crash\"].coolDown.expirationTime <= GetTime() + 3\n    and attackMode ~= \"Focus\"\n    then\n        -- Wait for dot in multi target if Shadow Crash comes off cool down soon\n        shadowActions[\"Vampiric Touch\"].priority = nil        \n    elseif shadowData.vampiricTouch.target.missing + shadowData.vampiricTouch.target.expiring == 1 and attackMode == \"Focus\"\n    and (coolDown.channel.name == nil or coolDown.channel.name ~= \"Mind Flay\")\n    and not shadowActions[\"Vampiric Touch\"].casting.active\n    then    \n        shadowActions[\"Vampiric Touch\"].priority = 2 \n    elseif shadowData.vampiricTouch.missing + shadowData.vampiricTouch.expiring > 1 and attackMode ~= \"Focus\"\n    then        \n        shadowActions[\"Vampiric Touch\"].priority = 2\n    elseif shadowData.vampiricTouch.missing + shadowData.vampiricTouch.expiring == 1 \n    and not shadowActions[\"Vampiric Touch\"].casting.active and attackMode ~= \"Focus\"\n    then \n        shadowActions[\"Vampiric Touch\"].priority = 2\n    end                \n    \n    return isAuraHighestPriority(\"Vampiric Touch\", shadowActions)\n    \nend\n\n\n\n",
